function App() {
  return (
    <div className="blank">
      <h1>{user.name}</h1>
      <img className="avatar" src={user.imageUrl} alt={'Photo of'+user.name} style={{width:user.imageSize,height:userimageSize}} />
      <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Ullam assumenda possimus, alias et omnis iure sint harum iusto. Voluptatum optio quibusdam voluptate expedita consequuntur eius suscipit repellendus soluta laudantium qui.</p>
      <li>First</li>
      <li>Second</li>
      <li>Third</li>
      <br />
      <button className="btn">submit</button>
    </div> 
  );
}
function MyButton(){
  return(
    <div className="blank">
      <button >I'am button</button>
    </div>

  );
}
let user ={
  name:"Shivani Shinde",
  imageUrl:'https://unsplash.com/photos/a-woman-sitting-in-a-chair-with-a-neon-shirt-on-h1ut3Po_qKY',
  imageSize:90,

}
export default function app(){
  return(
    <div className="blank">
      <App/>
      <h1>welcome to My app</h1>
      <MyButton/>
    </div>
  );
};
